import React, { useEffect, useState } from "react";
import axios from "axios";

const API_URL =
  "https://covid-api.mmediagroup.fr/v1/history?country=Australia&status=confirmed";

const GetData = () => {
    var labels, nswCases, vicCases, data;
    fetch(API_URL)
    .then(res => res.json())
    .then(
        (result) => {
            data = result;
        }
    )

  //Ensures data is not null, parses the JSON into NSW data and VIC data
  console.log(data);
  if(data){
  labels = Object.keys(data["All"].dates).reverse();
  //NSW DATA
  nswCases = Object.values(data["New South Wales"].dates).reverse();
  nswCases = nswCases.map((v, i, a) => v - (a[i - 1] || 0));
  //VIC DATA
  vicCases = Object.values(data["Victoria"].dates).reverse();
  vicCases = vicCases.map((v, i, a) => v - (a[i - 1] || 0));

  }
  return { labels, nswCases, vicCases };
};

export default GetData;
